import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({getQuestionId}){

function GetId(id) {
    getQuestionId(id);
}

    return(
        <Paper>
            <h1>Detail's page</h1>  
            <p>{GetId.title}</p>
        </Paper>
    )
}
export default Question;
